kernel void lrn_full_no_scale_float(const int nthreads, global const float* in, const int num, const int channels, const int height, const int width, const int size, const float alpha_over_size, const float k, global float* const out, const float negative_beta) {
  for (int index = get_global_id(0); index < nthreads; index += get_global_size(0)) {
    const int w = index % width;
    const int h = (index / width) % height;
    const int n = index / width / height;
    const int offset = (n * channels * height + h) * width + w;
    const int step = height * width;
    global const float* in_off = in + offset;
    global float* out_off = out + offset;
    float scale_val;
    int head = 0;
    const int pre_pad = (size - 1) / 2;
    const int post_pad = size - pre_pad - 1;
    float accum_scale = 0;

    while (head < post_pad && head < channels) {
      accum_scale += in_off[head * step] * in_off[head * step];
      ++head;
    }

    while (head < channels) {
      accum_scale += in_off[head * step] * in_off[head * step];
      if (head - size >= 0) {
        accum_scale -= in_off[(head - size) * step] * in_off[(head - size) * step];
      }
      scale_val = k + accum_scale * alpha_over_size;
      out_off[(head - post_pad) * step] = in_off[(head - post_pad) * step] * (float)native_powr(scale_val, negative_beta);
      ++head;
    }

    while (head < channels + post_pad) {
      if (head - size >= 0) {
        accum_scale -= in_off[(head - size) * step] * in_off[(head - size) * step];
      }
      scale_val = k + accum_scale * alpha_over_size;
      out_off[(head - post_pad) * step] = in_off[(head - post_pad) * step] * (float)native_powr(scale_val, negative_beta);
      ++head;
    }
  }
}

kernel void gaussianFilter(global const float* fft, global float* out, int n, float gwidthFactor, float dt, global float* gaussVals) {
  int i = get_global_id(0);
  if (2 * i >= n)
    return;

  float df = 1 / (n * dt);
  float omega;
  float gauss;
  if (i == 0) {
    gauss = 1;
  } else {
    omega = i * 2 * 3.14159265358979323846f * df;
    gauss = exp(-omega * omega / (4 * gwidthFactor * gwidthFactor));
  }
  out[i * 2] = fft[i * 2] * gauss;
  out[i * 2 + 1] = fft[i * 2 + 1] * gauss;
  out[2 * n - i * 2] = fft[2 * n - i * 2] * gauss;
  out[2 * n - i * 2 + 1] = fft[2 * n - i * 2 + 1] * gauss;
  gaussVals[i] = gauss;
}

