kernel void asbs_gpu_gpu(global float* s1, global const float* fac2, unsigned int options2, global const float* s2, global const float* fac3, unsigned int options3, global const float* s3) {
  float alpha = fac2[0];
  if ((options2 >> 2) > 1) {
    for (unsigned int i = 1; i < (options2 >> 2); ++i)
      alpha += fac2[i];
  }
  if (options2 & (1 << 0))
    alpha = -alpha;
  if (options2 & (1 << 1))
    alpha = ((float)(1)) / alpha;

  float beta = fac3[0];
  if ((options3 >> 2) > 1) {
    for (unsigned int i = 1; i < (options3 >> 2); ++i)
      beta += fac3[i];
  }
  if (options3 & (1 << 0))
    beta = -beta;
  if (options3 & (1 << 1))
    beta = ((float)(1)) / beta;

  *s1 = *s2 * alpha + *s3 * beta;
}

