  size_t i = get_global_id(0);
  size_t index = start + i;

  float temp = 0;

  if (i < n)
    temp = (data[index] - model[index]) / data_err[index];

  output[index] = temp;
}

kernel void vecsum_loadadd(global const float* input_, global float* output_, local float* scratch_, const int length_) {
  int local_index = get_local_id(0);
  int local_size = get_local_size(0);
  int global_index = get_global_id(0);
  int global_size = get_global_size(0);
  int global_index2 = global_index + global_size;

  scratch_[local_index] = input_[global_index];
  if ((global_index + global_size) < length_) {
    scratch_[local_index] += input_[global_index + global_size];
  }

  barrier(0x01);

  for (int s = local_size / 2; s > 0; s >>= 1) {
    if (local_index < s) {
      scratch_[local_index] += scratch_[local_index + s];
    }
    barrier(0x01);
  }
  if (local_index == 0) {
    output_[get_group_id(0)] = scratch_[0];
  }
}

