kernel void expand_image_k_mask(global float* img, global float* exp_im, global float* kernel_mask, unsigned int im_width, unsigned int im_height, unsigned int exp_factor) {
  size_t i = get_global_id(0);
  int x = i % im_width;
  int y = i / im_width;

  int beg_x = x > 0 ? -1 : 0;
  int beg_y = y > 0 ? -1 : 0;

  int end_x = x < im_width ? 1 : 0;
  int end_y = y < im_height ? 1 : 0;

  int sub_pixel = -1;
  float dst_sum, k_sum;
  int k_offset = 0;
  for (int dy = 0; dy < exp_factor; ++dy) {
    for (int dx = 0; dx < exp_factor; ++dx) {
      sub_pixel = dy * exp_factor + dx;
      dst_sum = 0.0;
      k_sum = 0;
      for (int xp = beg_x; xp <= end_x; ++xp) {
        for (int yp = beg_y; yp <= end_y; ++yp) {
          k_offset = (9 * sub_pixel) + (3 * (1 + yp)) + xp + 1;

          dst_sum += img[i + xp + yp * im_width] * kernel_mask[k_offset];

          k_sum += kernel_mask[k_offset];
        }
      }

      dst_sum = !k_sum ? 0 : dst_sum / k_sum;

      exp_im[(dx + x * exp_factor) + (im_width * exp_factor) * (dy + y * exp_factor)] = dst_sum;
    }
  }
}

kernel void single_scan0(constant const uchar* bitcount_table, global const ulong* bitstrings, const unsigned int bs_len, const unsigned int sample, constant const ulong* bs, const unsigned int radius, global unsigned int* counter, global unsigned int* selected, local unsigned int* partial_dist) {
  unsigned int id = get_global_id(0);

  if (id < sample) {
    ulong a;
    unsigned int dist;

    const global ulong* row = bitstrings + id * bs_len;

    dist = 0;
    for (unsigned int j = 0; j < bs_len; j++) {
      a = row[j] ^ bs[j];
      dist += popcount(a);
    }
    if (dist <= radius) {
      selected[atomic_inc(counter)] = id;
    }
  }
}

kernel void greaterthan_m2(global float* outDest, int inWidth, int offset) {
  int x = (int)get_global_id(0);
  int y = (int)get_global_id(1);
  int x_cmp = x + offset;

  int index = (y * inWidth) + x;

  if (x < inWidth && y < inWidth) {
    outDest[index] = (x_cmp > -3) ? 1.0f : -1.0f;
  }
}

kernel void MatrixMultiplication_int(global int* matrixA, global int* matrixB, global int* output, int matrixSize, int matrixWidth) {
  int sum;
  int y = get_global_id(0);
  int x = get_global_id(1);

  sum = 0;
  for (int i = 0; i < matrixWidth; i++) {
    sum += matrixA[x * matrixWidth + i] * matrixB[i * matrixSize + y];
  }
  output[x * matrixSize + y] = sum;
}

kernel void Ssyr2_opt_async_upper(unsigned int n, float alpha, const constant float* x, int incx, const constant float* y, int incy, global float* A, unsigned int lda) {
  int row_id = get_global_id(0);
  int col_id = get_global_id(1);

  if (row_id <= col_id) {
    float rank_delta = fma(x[row_id * incx], y[col_id * incy], y[row_id * incy] * x[col_id * incx]);
    A[col_id * lda + row_id] = fma(alpha, rank_delta, A[col_id * lda + row_id]);
  }
}

