kernel void aes_rijndael_encrypt(constant unsigned int* rk_global, int Nr, global const uchar* pt_buf, global uchar* ct_buf) {
  unsigned int s0, s1, s2, s3, t0, t1, t2, t3;
  int r;

  local unsigned int Te0_local[256];

  Te0_local[get_local_id(0)] = Te0[get_local_id(0)];
  constant unsigned int* rk = rk_global;

  barrier(0x01);

  global const uchar* pt = pt_buf + get_global_id(0) * 16;
  global uchar* ct = ct_buf + get_global_id(0) * 16;

  unsigned int pt_0 = *(global const unsigned int*)(pt);
  unsigned int pt_1 = *(global const unsigned int*)(pt + 4);
  unsigned int pt_2 = *(global const unsigned int*)(pt + 8);
  unsigned int pt_3 = *(global const unsigned int*)(pt + 12);

