  s1 = __builtin_astype((__builtin_astype((pt_1), uchar4).wzyx), unsigned int) ^ rk[1];
  s2 = __builtin_astype((__builtin_astype((pt_2), uchar4).wzyx), unsigned int) ^ rk[2];
  s3 = __builtin_astype((__builtin_astype((pt_3), uchar4).wzyx), unsigned int) ^ rk[3];
