    t1 = Te0_local[__builtin_astype((s1), uchar4).w] ^ rotate(Te0_local[__builtin_astype((s2), uchar4).z], (unsigned int)24) ^ rotate(Te0_local[__builtin_astype((s3), uchar4).y], (unsigned int)16) ^ rotate(Te0_local[__builtin_astype((s0), uchar4).x], (unsigned int)8) ^ rk[4 * 1 + 1];
    t2 = Te0_local[__builtin_astype((s2), uchar4).w] ^ rotate(Te0_local[__builtin_astype((s3), uchar4).z], (unsigned int)24) ^ rotate(Te0_local[__builtin_astype((s0), uchar4).y], (unsigned int)16) ^ rotate(Te0_local[__builtin_astype((s1), uchar4).x], (unsigned int)8) ^ rk[4 * 1 + 2];
    t3 = Te0_local[__builtin_astype((s3), uchar4).w] ^ rotate(Te0_local[__builtin_astype((s0), uchar4).z], (unsigned int)24) ^ rotate(Te0_local[__builtin_astype((s1), uchar4).y], (unsigned int)16) ^ rotate(Te0_local[__builtin_astype((s2), uchar4).x], (unsigned int)8) ^ rk[4 * 1 + 3];
    rk += 8;
    if (--r == 0)
      break;
    s0 = Te0_local[__builtin_astype((t0), uchar4).w] ^ rotate(Te0_local[__builtin_astype((t1), uchar4).z], (unsigned int)24) ^ rotate(Te0_local[__builtin_astype((t2), uchar4).y], (unsigned int)16) ^ rotate(Te0_local[__builtin_astype((t3), uchar4).x], (unsigned int)8) ^ rk[4 * 0];
    s1 = Te0_local[__builtin_astype((t1), uchar4).w] ^ rotate(Te0_local[__builtin_astype((t2), uchar4).z], (unsigned int)24) ^ rotate(Te0_local[__builtin_astype((t3), uchar4).y], (unsigned int)16) ^ rotate(Te0_local[__builtin_astype((t0), uchar4).x], (unsigned int)8) ^ rk[4 * 0 + 1];
    s2 = Te0_local[__builtin_astype((t2), uchar4).w] ^ rotate(Te0_local[__builtin_astype((t3), uchar4).z], (unsigned int)24) ^ rotate(Te0_local[__builtin_astype((t0), uchar4).y], (unsigned int)16) ^ rotate(Te0_local[__builtin_astype((t1), uchar4).x], (unsigned int)8) ^ rk[4 * 0 + 2];
    s3 = Te0_local[__builtin_astype((t3), uchar4).w] ^ rotate(Te0_local[__builtin_astype((t0), uchar4).z], (unsigned int)24) ^ rotate(Te0_local[__builtin_astype((t1), uchar4).y], (unsigned int)16) ^ rotate(Te0_local[__builtin_astype((t2), uchar4).x], (unsigned int)8) ^ rk[4 * 0 + 3];
