  unsigned int ct_0 = __builtin_astype((__builtin_astype((((Te0_local[__builtin_astype((t0), uchar4).w] << 8) & 0xff000000) ^ (Te0_local[__builtin_astype((t1), uchar4).z] & 0x00ff0000) ^ (Te0_local[__builtin_astype((t2), uchar4).y] & 0x0000ff00) ^ ((Te0_local[__builtin_astype((t3), uchar4).x] >> 8) & 0x000000ff) ^ rk[0]), uchar4).wzyx), unsigned int);
