kernel void mysgemmNT(global const float* A, int lda, global const float* B, int ldb, global float* C, int ldc, int k, float alpha, float beta) {
  float c = 0.0f;
  int m = get_global_id(0);
  int n = get_global_id(1);

  for (int i = 0; i < k; ++i) {
    float a = A[m + i * lda];
    float b = B[n + i * ldb];
    c += a * b;
  }
  C[m + n * ldc] = C[m + n * ldc] * beta + alpha * c;
}

kernel void remainder_ushort2ushort2(global ushort2* src_0, global ushort2* src_1, global ushort2* dst) {
  int gid = get_global_id(0);
  dst[gid] = src_0[gid] % src_1[gid];
}

__attribute__((reqd_work_group_size(8, 8, 1))) __attribute__((reqd_work_group_size(8, 8, 1))) kernel void scan2_F32(global float* dest, global float* vert, int dest_step, int vert_step) {
  dest_step /= sizeof(float);
  vert_step /= sizeof(float);

  const int gx = get_global_id(0);
  const int gy = get_global_id(1);

  float Sum = 0;
  for (int i = 0; i <= gx; i++) {
    float v = dest[gy * dest_step + (i + 1) * 8 * 8 - 1];
    Sum += v;
  }

  vert[gy * vert_step + gx] = Sum;
}

kernel void test_clamp(global ulong3* out, global ulong3* in) {
  *out = clamp(*in, (ulong3)7, (ulong3)42);
}

kernel void trig(global const float4* a, global float4* b, float c) {
  int gid = get_global_id(0);

  switch (gid % 5) {
    case 0:
      b[gid] = cos(a[gid]);
      break;
    case 1:
      b[gid] = fabs(a[gid]) + c;
      break;
    case 2:
      b[gid] = sin(a[gid]);
      break;
    case 3:
      b[gid] = sqrt(a[gid]);
      break;
    case 4:
      b[gid] = tan(a[gid]);
      break;
  }
}

double2 when_eq(double2 x, double2 y) {
  return 1.0f - fabs(sign(x - y));
}
double when_neq(double x, double y) {
  return fabs(sign(x - y));
}

double2 when_gt(double2 x, double2 y) {
  return max(sign(x - y), 0.0);
}

double2 when_lt(double2 x, double2 y) {
  return min(1.0f - sign(x - y), 1.0f);
}

double2 when_ge(double2 x, double2 y) {
  return 1.0f - when_lt(x, y);
}

double2 when_le(double2 x, double2 y) {
  return 1.0f - when_gt(x, y);
}

double2 wrap(double2 vec) {
  double2 diff = when_gt(fabs(vec), 1.0);
  return -sign(vec) * 2.0 * diff + vec;
}

double3 calculateForcePotential(double2 p0, double2 p1) {
  double2 delta = 2.5e1 * wrap(p0 - p1);

  double diff = when_neq(length(delta), 0.0);
  double inv = rsqrt(dot(delta, delta) + 0.7);
  double r_2 = 1 * inv;
  r_2 *= r_2;
  double r_6 = r_2 * r_2 * r_2;
  double r_12 = r_6 * r_6;
  return diff * (double3)(48.0 * 1 * inv * inv * (r_12 - 0.5 * r_6) * delta, 4.0 * 1 * (r_12 - r_6));
}

double3 calculateForcePotential2(double2 p0, double2 p1) {
  double2 delta = 2.5e1 * wrap(p1 - p0);
  double diff = when_neq(length(delta), 0.0);
  double inv = rsqrt(dot(delta, delta) + 1);
  return diff * (double3)(delta * inv * inv * inv, -inv);
}

kernel void naive_update_velocity(global double2* position, global double2* velocity, global double2* energies) {
  int id = get_global_id(0);
  double2 base = position[id];
  double2 base_vel = velocity[id];

  double3 total_force = 0.0f;
  int N = get_global_size(0);
  for (int i = 0; i < N; i++)
    total_force += calculateForcePotential(base, position[i]);
  base_vel = base_vel + total_force.xy * 0.001;
  velocity[id] = base_vel;
  energies[id] = 0.5 * (double2)(total_force.z, 2.5e1 * dot(base_vel, base_vel));
}

